Aquí tienes un ejemplo de una función compleja en JavaScript que calcula el factorial de un número usando recursión:

```javascript
function factorial(n) {
    if (n === 0) {
        return 1;
    } else {
        return n * factorial(n - 1);
    }
}

let numero = 5;
let resultado = factorial(numero);
console.log(`El factorial de ${numero} es: ${resultado}`);
```

